import {  useState } from 'react';

const Greeting = () => {

    const [changedText, setChangedText] = useState(false);

    return (
        <div>
            <h2>
                Hello World !
            </h2>
            <p>
                It's good to see you !
            </p>
        </div>
    );
};

export default Greeting;
